import React from 'react'

const AddPaciente = () => {
  return (
    <div className='bg-white w-10/12 p-4'>
        <label htmlFor="Cedula">Cedula</label>
        <input type="text" name="Cedudla" id="Cedula" minLength={10} maxLength={10}/>
        <label htmlFor="Nombre">Nombre</label>
        <input type="text" name="Nombre" id="Nombre" minLength={1} maxLength={200}/>
    </div>
  )
}

export default AddPaciente
